angular.module('ifiske.filters', [])
.filter('onebr', function() {
    return function(input) {
        return input.replace(/(<br>\s*)+/g, '<br>');
    };
})
.filter('nobrs', function() {
    return function(input) {
        return input.replace(/(<br(\s*\/)*>)+/g, '');
    };
})
.filter('cleantables', function() {
    return function(input) {
        input = input.replace(/(<\/?table>)+/g, '');
        input = input.replace(/(<\/?tr>)+/g, '');
        input = input.replace(/(<\/?th>)+/g, '');
        input = input.replace(/(<(\/?)td.*?>)+?/g, '<$2p>');
        input = input.replace(/<p>\s*<\/p>/g, '');
        return input;
    };
});

(function(angular, undefined) {
    'use strict';

    angular.module('ifiske.update', ['ifiske.api', 'ifiske.db', 'ifiske.utils'])
    .provider('Update', function UpdateProvider() {

        this.$get = [
            'API',
            'DB',
            'localStorage',
            '$q',
            '$ionicLoading',
            'sessionData',
            function(API, DB, localStorage, $q, $ionicLoading, sessionData) {

                var LAST_UPDATE = 'last_update';

                var populate = function() {
                    return $q.all([
                        API.get_areas()
                        .then(function(data) {
                            var fishArr = [];
                            for (var key in data) {
                                var fishes = data[key].fish;
                                for (var fishKey in fishes) {
                                    fishArr.push({
                                        'ID': key + '_' + fishKey,
                                        fid: fishKey,
                                        aid: key,
                                        amount: fishes[fishKey][0],
                                        comment: fishes[fishKey][1]
                                    });
                                }
                            }
                            return $q.all([
                                DB.populateTable('Area', data),
                                DB.populateTable('Area_Fish', fishArr)
                            ])
                            .then(function() {
                                return 'Area';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_products()
                        .then(function(data) {
                            return DB.populateTable('Product', data)
                            .then(function() {
                                return 'Product';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_counties()
                        .then(function(data) {
                            return DB.populateTable('County', data)
                            .then(function() {
                                return 'County';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_municipalities()
                        .then(function(data) {
                            return DB.populateTable('Municipality', data)
                            .then(function() {
                                return 'Municipality';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_fishes()
                        .then(function(data) {
                            return DB.populateTable('Fish', data)
                            .then(function() {
                                return 'Fish';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_rules()
                        .then(function(data) {
                            return DB.populateTable('Rule', data)
                            .then(function() {
                                return 'Rule';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_techniques()
                        .then(function(data) {
                            return DB.populateTable('Technique', data)
                            .then(function() {
                                return 'Technique';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_organizations()
                        .then(function(data) {
                            return DB.populateTable('Organization', data)
                            .then(function() {
                                return 'Organization';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_map_pois()
                        .then(function(data) {
                            return DB.populateTable('Poi', data)
                            .then(function() {
                                return 'Poi';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_map_poi_types()
                        .then(function(data) {
                            return DB.populateTable('Poi_Type', data)
                            .then(function() {
                                return 'Poi_Type';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        }),
                        API.get_map_polygons()
                        .then(function(data) {
                            return DB.populateTable('Polygon', data)
                            .then(function() {
                                return 'Polygon';
                            }, function(err) {
                                console.warn(err);
                                return $q.reject(err);
                            });
                        })
                    ]);
                };

                var populateUser = function() {
                    return $q.all([
                        API.user_products()
                        .then(function(data) {
                            console.log(data);
                            return DB.populateTable('User_Product', data)
                            .then(function() {
                                return 'User_Product';
                            }, function(err) {
                                console.log(err);
                                return $q.reject(err);
                            });
                        }),
                        API.user_info()
                        .then(function(data) {
                            var numbers = data.numbers;
                            var numArr = [];
                            for (var i = 0; i < numbers.length; ++i) {
                                numArr.push({'number': numbers[i]});
                            }
                            return $q.all([
                                DB.populateTable('User_Info', [data])
                                .then(function() {
                                    return 'User_Info';
                                }, function(err) {
                                    console.log(data);
                                    console.log(err);
                                    return $q.reject(err);
                                }),
                                DB.populateTable('User_Number', numArr)
                                .then(function() {
                                    return 'User_Numbers';
                                }, function(err) {
                                    console.log(err);
                                    return $q.reject(err);
                                }),
                            ]);
                        })
                    ]);
                };

                var cleanUser = function() {
                    return $q.all([
                        DB.cleanTable('User_Product'),
                        DB.cleanTable('User_Number'),
                        DB.cleanTable('User_Info')
                    ])
                    .then(function() {
                        console.log('Removed user info from database');
                    }, function(err) {
                        console.log('Could not remove user data from database!', err);
                    });
                };

                var updateFunc = function(forced) {
                    $ionicLoading.show();

                    var currentTime = Date.now();

                    var lastUpdate = 0;
                    if (!forced) {
                        lastUpdate = localStorage.get(LAST_UPDATE);
                    }

                    var aWeek = 1000 * 3600 * 24 * 7;
                    if (currentTime - lastUpdate > aWeek) {
                        return $q.all([
                            DB.init()
                            .then(function() {
                                console.log('Initialized DB system');
                                if (sessionData.token) {
                                    return $q.all([
                                        populateUser(),
                                        populate()
                                    ]);
                                } else {
                                    return populate();
                                }
                            })

                            .then(function(stuff) {
                                console.log('Populated:', stuff);
                                localStorage.set(LAST_UPDATE, currentTime);
                                $ionicLoading.hide();
                            }, function(err) {
                                if (err.error_code === 7) {
                                    // Authentication failure
                                    // TODO: Show to user
                                    cleanUser();
                                    API.user_logout();
                                    $ionicLoading.hide();
                                } else {
                                    console.warn('Got an error, will try to recreate all tables:', err);

                                    return DB.clean()
                                    .then(function() {
                                        return DB.init();
                                    })

                                    .then(function() {
                                        return populate();
                                    })

                                    .then(function(stuff) {
                                        console.log('Populated:', stuff);
                                        localStorage.set(LAST_UPDATE, currentTime);
                                        $ionicLoading.hide();
                                    }, function(err) {
                                        console.log('Still error, handle it!', err);
                                        $ionicLoading.hide();
                                    });
                                }
                            }),
                            API.get_terms_of_service()
                            .then(function(data) {
                                localStorage.set('tos', data);
                            }),
                            API.get_sms_terms()
                            .then(function(terms) {
                                localStorage.set('sms_terms', terms);
                            }),
                            API.get_contact_info()
                            .then(function(data) {
                                localStorage.set('contactInfo', data);
                            }),
                            API.get_mapbox_api()
                            .then(function(data) {
                                localStorage.set('mapbox_api', data);
                            })
                        ]);

                    } else if (sessionData.token) {
                        return DB.init()
                        .then(function() {
                            console.log('Initialized DB system');
                            if (sessionData.token) {
                                populateUser()
                                .then(function() {
                                    $ionicLoading.hide();
                                }, function(err) {
                                    console.error(err);
                                    $ionicLoading.hide();
                                });
                            }
                            $ionicLoading.hide();
                        });
                    } else {
                        console.log('no_update');
                        $ionicLoading.hide();
                        return $q.when('No update');
                    }
                };

                return {
                    update: function() {
                        return updateFunc();
                    },

                    forcedUpdate: function() {
                        return updateFunc(true);
                    },

                    user_logout: function() {
                        cleanUser();
                        return API.user_logout();
                    },
                    user_login: function(username, password) {
                        return API.user_login(username, password)
                        .then(function() {
                            updateFunc();
                        });
                    },
                    last_update: function() {
                        return localStorage.get(LAST_UPDATE);
                    }
                };
            }
        ];
    });
})(window.angular);

angular.module('ifiske.utils', [])

.factory('localStorage', ['$window', function($window) {
    return {
        set: function(key, value) {
            $window.localStorage.setItem(key, value);
        },
        get: function(key) {
            return $window.localStorage.getItem(key);
        },
        remove: function(key) {
            $window.localStorage.removeItem(key);
        }
    };
}])
.service('sessionData', ['localStorage', function(localStorage) {
    this.token = localStorage.get('session');

    this.setToken = function(t) {
        localStorage.set('session', t);
        this.token = t;
        console.log('token set');
    };
    this.deleteToken = function() {
        localStorage.remove('session');
        this.token = null;
        console.log('token unset');
    };
}])
